// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { renderPopupCommandBar } from 'js/AwServerVisibilityCommandBarService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwServerVisibilityCommandBarService', () => import('js/AwServerVisibilityCommandBarService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "renderPopupCommandBar",
            "deps": "js/AwServerVisibilityCommandBarService"
        }
    },
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "mselected": {
            "type": "object"
        },
        "pselected": {
            "type": "object"
        },
        "anchor": {
            "type": "string"
        },
        "orientation": {
            "type": "string"
        },
        "reverse": {
            "type": "string"
        },
        "context": {
            "type": "object"
        }
    },
    "_viewModelId": "AwServerVisibilityPopupCommandBar",
    "_uniqueViewModelId": "AwServerVisibilityPopupCommandBar"
};




/*
define component
*/
const Component = createComponent( declViewModelJson, renderPopupCommandBar, undefined, ctxImportObj );

export default Component;
